      const pageSize = 180;
      window.addEventListener("DOMContentLoaded", async () => {
        await navigator.permissions.query({ name: "clipboard-read" });
        await navigator.permissions.query({ name: "clipboard-write" });
        const loadIcons = (iconsList) => {
          for (icon of iconsList) {
            const img = document.createElement("img");
            img.src = "icons/" + icon;
            const a = document.createElement("a");
            a.href = "icons/" + icon;
            a.download = icon;
            a.appendChild(img);
            document.querySelector(".icons").appendChild(a);
          }
        };
        loadIcons(allIcons.slice(0, pageSize));
        const loadMoreButton = document.getElementById("load-more");
        let page = 1;
        loadMoreButton.onclick = () => {
          loadIcons(allIcons.slice(page * pageSize, (page + 1) * pageSize));
          page++;
          if (page * pageSize >= allIcons.length) {
            loadMoreButton.remove();
          }
        };
        const searchInput = document.getElementById("search");
        searchInput.oninput = () => {
          const query = searchInput.value.toLowerCase();
          if (query === "") {
            document.querySelector(".icons").innerHTML = "";
            document.querySelector("#load-more").removeAttribute("disabled");
            loadIcons(allIcons.slice(0, pageSize));
            return;
          } else if (query.length < 2) {
            return;
          }
          const filteredIcons = allIcons.filter((icon) => {
            return icon
              .substring(0, icon.length - 4)
              .replace(/[ \.]/g, "")
              .includes(query.replace(/[ \.]/g, ""));
          });
          document.querySelector(".icons").innerHTML = "";
          document.querySelector("#load-more").setAttribute("disabled", true);
          loadIcons(filteredIcons);
        };
      });
    </script>

  <body>
    <input type="text" id="search" placeholder="Search icon" />
    <div class="icons"></div>
    <button id="load-more">Load more</button>
  </body>
